// MapCreateBulk creates a bulk creation builder from the given slice. For each item in the slice, the function creates
// a builder and applies setFunc on it.
func (c *WordInfoClient) MapCreateBulk(slice any, setFunc func(*WordInfoCreate, int)) *WordInfoCreateBulk {
	rv := reflect.ValueOf(slice)
	if rv.Kind() != reflect.Slice {
		return &WordInfoCreateBulk{err: fmt.Errorf("calling to WordInfoClient.MapCreateBulk with wrong type %T, need slice", slice)}
	}
	builders := make([]*WordInfoCreate, rv.Len())
	for i := 0; i < rv.Len(); i++ {
		builders[i] = c.Create()
		setFunc(builders[i], i)
	}
	return &WordInfoCreateBulk{config: c.config, builders: builders}
}

